//import React from 'react';

function App() {
  return (

    <div>
      <div>
      <h1>SongApp</h1>
      </div>

      <div>
        <h3>Filter by</h3>
        <input type="radio" name="song" id="song"/>
        <label htmlFor="song">Song</label>

        <input type="radio" name="song" id="artist"/>
        <label htmlFor="artist">Artist</label>

        <input type="radio" name="song" id="year"/>
        <label htmlFor="year">Year</label>

        <input type="text" />
      </div>
    </div>

  );
}

export default App;
